import Navigation from './Components/All/navigation'
import Nav from "./Nav";
import Listpost from "./Components/Post/Listpost";
import { NavLink } from "react-router-dom";
import { useEffect } from 'react';
export default function Dashboard() {

    useEffect(()=>{
        var name = JSON.pars(localStorage.getItem('user-info'));
        console.log(name);
    },[])

    return (<div>

        <Nav />
        <Navigation navigation="Dashboard"

            nav={
                <ul className="nav justify-content-center">
                    <li className="nav-item">
                        <NavLink extract className="mr-3 navs-header" to="/addpost">Add Post</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink extract className="navs-header" to="/user">User</NavLink>
                    </li>
                </ul>
            }
        />


        <div className="pt-md-5">
            <div className="container px-5">
                <div className="row gx-5 align-items-center">
                    <div className="col">
                        <h1 className="text-center">All Post</h1>
                        <Listpost />
                    </div>
                    {/* <div className="col">
                    </div> */}
                </div>
            </div>
        </div>
    </div>);
}
